import React, { useEffect, useState } from 'react';
import axios from 'axios';

function Side_work() {
    const fetchData = async () => {
        try {
            const response = await axios.get('https://picsum.photos/v2/list?page=2&limit=20');
            console.log('Fetched data:', response.data);
        } catch (error) {
            console.error('Error fetching data:', error);
        }       
    };
  const [userdata, setUserdata] = useState([]);

  
  useEffect(() => {
    console.log("State is changed:", userdata);
  }, [userdata]); 

  
  const update = () => {
    setUserdata();
  };

  return (
    <div className='d-flex justify-content-center align-items-center  mt-5'>
      <button onClick={update} className='btn btn-danger'>
        Update
      </button> <br/>
      <h1 className='ms-3'>{userdata}</h1>
    </div>
  );
}

export default Side_work;
